function mapDrawing() {  //干渉色標高図の描画

    //地理院地図の標高色データ列の初期化
    g__id =""

    //各入力値(文字列)を取得
    str_minHeight = document.getElementById( "minHeight" ).value;
    str_maxHeight = document.getElementById( "maxHeight" ).value;
    str_originHeight = document.getElementById( "originHeight" ).value;
    str_cycleHeight = document.getElementById( "cycleHeight" ).value;
    str_cycleTone = document.getElementById( "cycleTone" ).value;
    str_zoomPosition = document.getElementById( "zoomPosition" ).value;

    //文字列を数値に変換
    minHeight = Number(str_minHeight);
    maxHeight = Number(str_maxHeight);
    cycleHeight = Number(str_cycleHeight);
    cycleTone = Number(str_cycleTone);
    originHeight = Number(str_originHeight);

    //最大最小次数、開始・終端端副次数、最大・最小標高修正値、総階調数、色シフト、1～3次色周期を計算
    minDeg = Math.floor( minHeight / cycleHeight );
    maxDeg = Math.floor( maxHeight / cycleHeight );
    startSubdeg = Math.floor(( minHeight - cycleHeight * minDeg ) / ( cycleHeight / cycleTone ));
    endSubdeg = Math.floor(( maxHeight - cycleHeight * maxDeg ) / ( cycleHeight / cycleTone ));
    minHeightModefied = cycleHeight * minDeg + Math.floor( startSubdeg * ( cycleHeight / cycleTone ));
    maxHeightModefied = cycleHeight * maxDeg + Math.floor( endSubdeg * ( cycleHeight / cycleTone ));
    totalTone = ( cycleTone - startSubdeg ) + endSubdeg + ( maxDeg - minDeg -1 ) * cycleTone;
    shiftColor = mod( originHeight ,cycleHeight ) * cycleTone / cycleHeight;
    cycleHeight_1st = originHeight + cycleHeight;
    cycleHeight_2nd = originHeight + 2 * cycleHeight;

    //計算値を文字列に変換
    str_minDeg = String(minDeg);
    str_maxDeg = String(maxDeg);
    str_startSubdeg = String(startSubdeg);
    str_endSubdeg = String(endSubdeg);
    str_minHeightModefied = String(minHeightModefied);
    str_maxHeightModefied = String(maxHeightModefied);
    str_totalTone = String(totalTone);

    if (originHeight > maxHeight){
        str_cycleHeight_0th = "";
      }else{
        str_cycleHeight_0th = String(originHeight);
      }

    if (cycleHeight_1st > maxHeight || cycleHeight_1st < minHeight){
        str_cycleHeight_1st = "";
      }else{
        str_cycleHeight_1st = String(cycleHeight_1st);
      }

    if (cycleHeight_2nd > maxHeight || cycleHeight_2nd < minHeight){
        str_cycleHeight_2nd = "";
      }else{
        str_cycleHeight_2nd = String(cycleHeight_2nd) + "…";;
      }


    //最小次の処理

    //開始端の処理
    i = minDeg;
    j = startSubdeg;

    height=Math.floor(i*cycleHeight+j*cycleHeight/cycleTone);
    colorNumber = Math.floor(( j + mod( shiftColor ,cycleTone )) * 5000 / cycleTone ) % 5000;
    if (height < 0) {
        hexHeight = (Math.abs(height)).toString(16);
        g__id = g__id + "-" + String(hexHeight);
    }else{
        hexHeight = height.toString(16);
        g__id = g__id + String(hexHeight);
    }
    g__id = g__id + "G" + colorCode[colorNumber];

    //最小次の繰返し
    for ( let j = startSubdeg + 1 ; j < cycleTone ; j++ ){
        height=Math.floor(i*cycleHeight+j*cycleHeight/cycleTone);
        colorNumber = Math.floor(( j + mod( shiftColor ,cycleTone )) * 5000 / cycleTone ) % 5000;

        if (height < 0) {
            hexHeight = (Math.abs(height)).toString(16);
            g__id = g__id + "G-" + String(hexHeight);
        }else{
            let hexHeight = height.toString(16);
            g__id = g__id + "G" + String(hexHeight);
        }
        g__id = g__id + "G" + colorCode[colorNumber];
    }

    //中間次の処理
    for (let i = minDeg +1; i < maxDeg ; i++ ){
        for ( let j = 0 ; j < cycleTone ; j++ ){
            height=Math.floor(i*cycleHeight+j*cycleHeight/cycleTone);
            colorNumber = Math.floor(( j + mod( shiftColor ,cycleTone )) * 5000 / cycleTone ) % 5000;
            if (height < 0) {
                hexHeight = (Math.abs(height)).toString(16);
                g__id = g__id + "G-" + String(hexHeight);
            }else{
                let hexHeight = height.toString(16);
                g__id = g__id + "G" + String(hexHeight);
            }
            g__id = g__id + "G" + colorCode[colorNumber];
        }
    }

    //最大次の処理
    i = maxDeg;
    for ( let j = 0 ; j < endSubdeg ; j++ ){
        height=Math.floor(i*cycleHeight+j*cycleHeight/cycleTone);
        colorNumber = Math.floor(( j + mod( shiftColor ,cycleTone )) * 5000 / cycleTone ) % 5000;

        //終末端の処理            
        if (height = maxHeightModefied){
        g__id = g__id + "GG" + colorCode[colorNumber];
        }else{
            if (height < 0) {
                hexHeight = (Math.abs(height)).toString(16);
                g__id = g__id + "G-" + String(hexHeight);
            }else{
                let hexHeight = height.toString(16);
                g__id = g__id + "G" + String(hexHeight);
            }
            g__id = g__id + "G" + colorCode[colorNumber];
        }
    }

    //設定表示の書き換え
    document.getElementById("output_minHeight").innerHTML     = str_minHeightModefied; 
    document.getElementById("output_maxHeight").innerHTML     = str_maxHeightModefied; 
    document.getElementById("output_originHeight").innerHTML  = str_originHeight; 
    document.getElementById("output_cycleHeight").innerHTML   = str_cycleHeight; 
    document.getElementById("output_cycleTone").innerHTML     = str_cycleTone; 
    document.getElementById("output_zoomPosition").innerHTML  = str_zoomPosition; 
    document.getElementById("output_totalTone1").innerHTML     = str_totalTone;
    document.getElementById("output_totalTone2").innerHTML     = str_totalTone;
    document.getElementById("output_cycleHeight_0th").innerHTML   = str_cycleHeight_0th; 
    document.getElementById("output_cycleHeight_1st").innerHTML   = str_cycleHeight_1st; 
    document.getElementById("output_cycleHeight_2nd").innerHTML   = str_cycleHeight_2nd; 

    //地理院地図の書き換え
    document.getElementById('mapFrame1').contentWindow.location.replace('https://ymd5022002.github.io/map-art-jp/gsi/?hc=hc'+ str_zoomPosition + mapSettings + g__id);

    //地理院地図の倍率緯度経度値からGoogleマップのURLを生成
    var index1 = str_zoomPosition.indexOf('/');
    var str_zoom = str_zoomPosition.substr( 1,index1-1 );
    var str_latlong =  str_zoomPosition.substr( index1 + 1 );  //lat-->緯度、long-->経度
    var index2 = str_latlong.indexOf('/');
    var str_lat = str_latlong.substr( 0,index2 );
    var str_long = str_latlong.substr( index2 +1 );
    var google_zoom = Math.round(135175518.4397690*(2**(-2-str_zoom)) * 10000000) / 1000000 ; //*(2**(1-str_zoom))

    //Googleマップの書き換え
    document.getElementById('mapFrame2').contentWindow.location.replace("https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d"+google_zoom+"!2d"+str_long+"!3d"+str_lat+"!3m2!1i1024!2i768!4f13.1!5e1!3m2!1sja!2sjp!4v1598550150171!5m2!1sja!2sjp");

    n++;

    gsiURL='https://maps.gsi.go.jp/'+ str_zoomPosition + mapSettings +g__id

    var imgElements = document.querySelectorAll('.cycleHeight_button img');
    for (var i=0;i<imgElements.length;i++){
        if(imgElements[i].getAttribute("alt")==str_cycleHeight){
        imgElements[i].style.border="2px solid #5480C8";
        imgElements[i].style.borderRadius = "5px";
        }else{
        imgElements[i].style.border="2px solid #FCFDFE";
        imgElements[i].style.borderRadius = "5px";
        }
    }
}

function zoomPositionPaste(){       //地図URLから倍率緯度経度を貼りつける関数

    //地図URL欄からデータを取得
    var data = document.getElementById( "mapsURL" ).value;

    //地理院地図の場合の倍率緯度経度の抽出        
    if( data.substring( 0 ,23 ) == "https://maps.gsi.go.jp/"){
        str_zoomPosition = data;
        var index = str_zoomPosition.indexOf('#');
        console.log(index);//str_zoomPosition)

        str_zoomPosition = str_zoomPosition.substr( index );
        index = str_zoomPosition.indexOf('&');            
        str_zoomPosition = str_zoomPosition.substring( 0 ,index-1 );
    }

    //google マップの場合の倍率緯度経度の抽出          
    if( data.substring( 0 ,28 ) == "https://www.google.com/maps/"){
        var tmp = data;
        var index1 = tmp.indexOf('@');
        tmp = tmp.substr( index1 + 1 );
        var index2 = tmp.indexOf('/');
        tmp = tmp.substring( 0 ,index2 -2 )
        var tmp2 = tmp.split(",");
        var str_lat = tmp2[0]
        var str_lng = tmp2[1]
        var googleZoom = Number(tmp2[2])
        var z = Math.round(-4-Math.log2(googleZoom / 135175518.4397690))
        str_zoomPosition = "#" + z + "/" + str_lat + "/" + str_lng
    }

    //倍率緯度経度の貼り付け
    document.getElementById( "zoomPosition" ).value = str_zoomPosition;
    document.getElementById( "mapsURL" ).value = "";
    mapsURL = "";

}

