function mod(i,j) {   //Javascript は　負の剰余が負の値になる(例：(−5) %　2 = -1 )定義なので、正になる剰余関数を定義する。
    return (i % j) < 0 ? (i % j) + 0 + (j < 0 ? -j : j) : (i % j + 0);
}

